import React from "react";


const Show = (props: any) => {
  return (
    <div>
    <table>
    <thead>
      <tr>
      <th><img src={props.image} alt='cryptocurrency'/></th>
      <th> <h3>{props.name}</h3></th>
      <th><p>{props.symbol.toUpperCase()}</p></th>
      <th><p>${props.price}</p> </th>
      <th><p>{props.priceChange}%</p></th>
      </tr>
      </thead>
      </table>
    </div>
  );
};

export default Show;
